import React from 'react';
import '../VoiceSearch/index.css';
import { faMicrophone } from '@fortawesome/free-solid-svg-icons';


function VoiceSearch() {

    return (
        <div className='container-fluid d-flex align-item-center justify-content-center  voiceModel'>
          <div className='col-md-4 bg-light voice-search'>
                <div className='border-bottom w-100 d-flex align-items-center justify-content-between py-2'> 
                <h3>Voice Search</h3>
                <i className='fa fa-times btn btn-sm'>

                </i>
                </div>
                <div className=' w-100 d-flex align-items-center justify-content-center py-2'>
                  <div className='col-md-2  micIcon d-flex align-item-center justify-content-center bg-danger text-white'>
                  <FontAwesomeIcon icon="fa-regular fa-microphone" />

                  </div>
                </div>
          </div>
        </div>
    );
}

export default VoiceSearch;
